Information
------------------------------

Oscar Pistorius: The Truth
Documentary going behind the scenes of the Oscar Pistorius murder trial, following victim Reeva Steenkamp's parents as they prepare for the court case and interviewing them after the verdict is announced. Pistorius, the world's most famous Paralympic athlete, admits he shot four bullets that killed Steenkamp, a model and reality TV star. However, the athlete says he fired in the mistaken belief that an intruder was breaking into his home. The judge has now found him guilty of culpable homicide - manslaughter.

